import React from 'react';
import axios from 'axios';
import { Redirect } from 'react-router';
import { Link } from 'react-router-dom';
import {useLocation} from "react-router-dom";
import Settings from './Settings.js'
import {Route,PrivateRoute} from 'react-router-dom';
import { BrowserRouter as Router } from 'react-router-dom';
import './Plot.css'
import { withRouter} from 'react-router-dom';
class Plot  extends React.Component {
	constructor(props) {
   		super(props);
   		 this.state = {
	     	 	email: "",
	     	 	id:-1,
	    	};
   		this.goSettings = this.goSettings.bind(this);
   		this.goHome =this.goHome.bind(this);
   		this.goPersonal=this.goPersonal.bind(this);
   		if(props.location.state != null){
	    		this.state.id=props.location.state.id
	    	}
  	}
  	goSettings = event => {
  		event.preventDefault()
  		alert(this.props.id)
  		this.props.history.push({
          pathname: '/Settings/${this.props.id}',
          state :{
          Email : this.props.email,
          id: this.props.id,
          page : "Settings",
          isLogin: true
          }
       })
  	}
  	goPersonal = event =>{
  		event.preventDefault()
  		alert(this.props.id)
  		alert(this.props.email)
  		this.props.history.push({
          pathname: '/Personal/${this.props.id}',
          state :{
          Email : this.props.email,
          id: this.props.id,
          page : "Main_Page",
          isLogin: true
          }
       })
  	}
  	goHome = event =>{
  		event.preventDefault()
  		alert(this.props.id)
  		alert(this.props.email)
  		this.props.history.push({
          pathname: "/UserPage/:"+this.state.id,
          state :{
          Email : this.props.email,
          id   :this.props.id,
          page : "Main_Page",
          isLogin: true
          }
       })
